import React from 'react'

export default function Waiting() {
    return (
        <div style={{
            height: "100vh",
            display: "flex",
            alignItems: "center",
            alignContent: "center",
            justifyContent: "center",
            background: "radial-gradient(circle, #1f1f1f 40%, darkblue 40%, midnightblue 45%, #1f1f1f 45%)",
        }}>
            <h1 style={{
                color: "darkgrey",
                fontSize: "30px",
                margin: "0px",
                position: "absolute",
                top: "50%",
                left: "50%",
                transform: "translate(-50%, -50%)",
                fontWeight: "bold",
            }}>I  <span style={{
                color: "#3676ff",
            }}>wonder</span> what <span style={{
                color: "#3676ff",
            }}>damage</span> you cause  <span style={{
                color: "#3676ff",
            }}>online</span>? <span style={{
                fontSize: "15px",
                color: "#3676ff",
            }}>Without even knowing</span></h1>
        </div>
    )
}
